#vadstena-engine-tools {
    font-family: helvetica, arial, sans-serif;
    font-size: 14px;
    position:absolute;
    right:10px;
    top:10px;
    cursor: default;
    background-color: rgba(255,255,255,0.95);
    border-radius: 5px;
    border: solid 1px #ccc;
    text-align: left;
    z-index: 4;
}

.vadstena-engine-tools * { margin: 0; padding: 0; }

#vadstena-engine-tools-menu {
    width:100%;
    height: 29px;
    text-align: right;
    border-bottom: 1px solid #ccc;
}

#vadstena-engine-tools-menu ul {
    display: inline-block;
    margin-right: 20px;
    margin-left: 20px;
    top: -3px;
    position: relative;
}

#vadstena-engine-tools-menu ul li {
    list-style-type: none;
    display: inline;
    border-top-left-radius: 5px;
    border-top-right-radius: 5px;
    border: solid 1px #ccc;
    padding: 2px 4px;
    margin-right: 2px;
    background-color: rgba(0,0,0,0.1);
    cursor: pointer;
}

#vadstena-engine-tools-menu ul li.vadstena-engine-tools-tab-selected {
    background-color: rgba(250,250,250,0.5);
    border-bottom: solid 1px #f0f0f0;
}
